import React from 'react';

export default function About() {
  return (
    <section id="about" className="min-h-screen flex flex-col items-center justify-center bg-gray-900 text-white py-16 px-4">
      <h2 className="text-3xl font-bold mb-4 text-purple-400">À propos</h2>
      <p className="max-w-2xl text-center text-lg">
        Je m'appelle Marewane Fertikh, étudiant en 2ᵉ année de BUT Informatique à l'IUT de Villetaneuse.
        Passionné par le développement et les mathématiques, je m'intéresse particulièrement à la Data et à l'IA.
        J'aime apprendre de nouvelles technologies et travailler en équipe sur des projets concrets.
      </p>
    </section>
  );
}
